(function() {
    $(document).ready(function () {
		//默认Json配置文件
		let $config = {
			"version": "",
			"title": "",
			"keyWord": "",
			"workType": "",
			"star": ""
		};
		//ui界面
		let $codeContent = '<div class="infoContent"> <div class="infoList"> <div class="capLine"></div> <div class="infoBox"> <ul> <li> <div class="classIcon"></div> <div class="classTitle">文件信息</div> </li> <li> <div class="rowLine"></div> </li> <li> <div class="listIcon orangeIcon"></div> <div class="textInfo"> <h3>工具版本</h3> <input type="text" id="versionInfo" class="textValue" placeholder="版本"> </div> </li> </ul> </div> <div class="infoBox"> <ul> <li> <div class="classIcon"></div> <div class="classTitle">作品信息</div> </li> <li> <div class="rowLine"></div> </li> <li> <div class="listIcon redIcon"></div> <div class="textInfo"> <h3>标题</h3> <input type="text" id="titleInfo" class="textValue" placeholder="高"> </div> </li> <li> <div class="listIcon yellowIcon"></div> <div class="textInfo"> <h3>关键词</h3> <input type="text" id="keyWordInfo" class="textValue" placeholder="关键词"> </div> </li> <li> <div class="listIcon blueIcon"></div> <div class="textInfo"> <h3>类型</h3> <input type="text" id="workTypeInfo" class="textValue" placeholder="类型"> </div> </li> <li> <div class="listIcon greenIcon"></div> <div class="textInfo spInfo"> <h3>星级</h3> <input type="text" id="priceInfo" class="textValue starInfo priceInfo" placeholder="星级"> </div> </li> </ul> </div> </div> <div style="color:#fff">学习交流：<br>“探索家”微信公众号</div><div class="saveInfo">保存配置</div> <div id="postSubmit">提交审核</div> </div> <style type="text/css"> ul, ul li { list-style: none; margin: 0; padding: 0; } .clearfl:after { content: ""; display: block; height: 0; clear: both; overflow: hidden; } .clearfl { *zoom: 1; } .infoContent { box-sizing: border-box; display: inline-block; width: 210px; background-color: #57607c; padding: 10px 28px 16px; position: relative; font-family: "microsoft yahei"; } .infoList { position: relative; } .capLine { width: 0; height: 100%; position: absolute; top: 0; border-left: 1px solid #324b5e; border-right: 1px solid #5f7586; } .infoBox { position: relative; padding-left: 20px; margin: 12px 0; } .classIcon { width: 10px; height: 10px; border-radius: 50%; background-color: #324b5e; position: absolute; left: -4px; top: 9px; } .classTitle { padding: 0 24px; display: inline-block; line-height: 28px; font-size: 14px; color: #fff; border-radius: 14px; background-color: #324b5e; } .rowLine { width: 100%; height: 0; border-top: 1px solid #324b5e; border-bottom: 1px solid #5f7586; margin-top: 16px; } .listIcon { width: 16px; height: 16px; border: 2px solid #fff; border-radius: 50%; position: absolute; left: -9px; } .textInfo h3 { font-size: 14px; color: #fff; line-height: 20px; margin: 12px 0; font-weight: normal; } .textInfo p { font-size: 10px; color: #c7d0e4; } .keyWordInfo { white-space: nowrap; /*为应用text-shadow做准备，禁止换行*/ overflow: hidden; text-overflow: ellipsis; } .jsonInfo{ width: 100%; height: 68px; background-color: #536d82; border: 1px solid #324b5e; border-radius: 4px; font-size: 14px; color: #c7d0e4; resize: none; } .textValue{ width: 100%; height: 28px; box-sizing: border-box; padding: 0 4px; background-color: #536d82; border: 1px solid #324b5e; border-radius: 4px; font-size: 14px; color: #c7d0e4; } .redIcon { background-color: #ff777d; border-color: #e94454; } .yellowIcon { background-color: #fdefc0; border-color: #f7b602; } .blueIcon { background-color: #c7ddf2; border-color: #0052c2; } .greenIcon { background-color: #5dc370; border-color: #008100; } .orangeIcon { background-color: #e8a876; border-color: #ff5201; } #postSubmit,.saveInfo { background-color: #5dc370; border: 2px solid #008100; border-radius: 20px; font-size: 14px; line-height: 32px; color: #fff; text-align: center; width: calc(100% + 11px); margin-top: 15px; position: relative; left: -10px; cursor: pointer; } </style>';
		$(".member-box").css({
			"width": "1200px",
		});
		$(".member-box").append($codeContent);
		//设置文件信息
		let fileInfo = (obj) => {
			//点击预览图并取消
			$("#J_showErrorTipBtn").click();
			$("div[data-pid='30']").click();
			//点击上传图片确定按钮
			$("#J_J_resetPreview").click();
			//工具版本
			$("#J_version").val(obj.version);
		};
		//设置作品信息
		let workInfo = (obj) => {
			//标题文本
			$("input[name='title']").val(obj.title);
			//关键词
			$("input[name='keyword']").val(obj.keyWord);
			//分类循环
			switch (obj.workType) {
				case "共享":
					//点击分类按钮
					$("#ad-originalPic").click();
					$(".assessmentItem[value='" + obj.star + "']").click();
					break;
				case "原创共享":
					//点击分类按钮
					$("#ad-originalShare").click();
					$(".assessmentItem[value='" + obj.star + "']").click();
					break;
			};
		};
		//导入配置信息ui
		let myConfig = GM_getValue("myConfig") ? GM_getValue("myConfig") : $config;
		let setConfig = (obj) => {
			$("#versionInfo").val(obj.version);
			$("#titleInfo").val(obj.title);
			$("#keyWordInfo").val(obj.keyWord);
			$("#workTypeInfo").val(obj.workType);
			$("#spInfo h3").val(obj.workType == "非商" ? "星级" : "星级");
			$("#priceInfo").val(obj.workType == "非商" ? obj.star : obj.star);
		};
		setConfig(myConfig);
		//自定义配置信息
		let $extendJson = (obj) => {
			let $newJsonInfo;
			let isjson = typeof (obj) == "object" && Object.prototype.toString.call(obj).toLowerCase() ==
				"[object object]" && !obj.length;
			if (isjson) {
				$newJsonInfo = $.extend({}, $config, obj);
			} else {
				$newJsonInfo = $config;
			};
			return $newJsonInfo;
		};
		//保存配置
		$(".saveInfo").on("click", function () {
			let $textobj = {
				"version": $("#versionInfo").val(),
				"title": $("#titleInfo").val(),
				"keyWord": $("#keyWordInfo").val(),
				"workType": $("#workTypeInfo").val(),
				"star": $(".starInfo").val(),
			};
			GM_setValue("myConfig", $extendJson($textobj));
			let myConfig = GM_getValue("myConfig");
			setConfig(myConfig);
			//console.log($(".works-info-box .font-tahoma:nth-of-type(2)").text().split('.')[0]);
			console.log("全部配置：" + JSON.stringify(myConfig));
		});
		//提交按钮事件
		$("#postSubmit").on("click", function () {
			fileInfo(GM_getValue("myConfig") ? GM_getValue("myConfig") : $config);
			workInfo(GM_getValue("myConfig") ? GM_getValue("myConfig") : $config);
			$("#J_submit").click();
		});
		//-----------------------------------------------------------------------------------------
		//keyCodeStatus默认配置
		$(document).keypress(function (e) {
			if (e.shiftKey && e.keyCode == 83) {
				GM_setValue("keyCodeStatus", true);
				console.log("自动填充：" + GM_getValue("keyCodeStatus"));
				$autoComplat();
			};
			if (e.shiftKey && e.keyCode == 80) {
				GM_setValue("keyCodeStatus", false);
				console.log("自动填充：" + GM_getValue("keyCodeStatus"));
			};
		});
		//配置菜单项自动填充
		GM_registerMenuCommand("自动填充", () => {
			GM_setValue("keyCodeStatus", true);
			console.log("自动填充：" + GM_getValue("keyCodeStatus"));
			$autoComplat();
		});
		GM_registerMenuCommand("停止填充", () => {
			GM_setValue("keyCodeStatus", false);
			console.log("自动填充：" + GM_getValue("keyCodeStatus"));
		});
		//自动填充函数
		let $autoComplat = () => {
			if (GM_getValue("keyCodeStatus", false) == true) {
				setTimeout(function () {
if (location.href.indexOf("pendings") > 0) {
						let idArr = [];
						$("#paddings-page tr").each(function (i, e) {
							idArr.push(e.id);
						});
						let address = location.href.slice(0,location.href.lastIndexOf("/")+1)+"audit_page?id="+idArr[0];
						location.href = address;
					};
					setInterval(function () {
						$("#falseConfirm .confirm-box a:nth-of-type(2) .close-floatbox")
							.click();
					}, 300);
					return setTimeout(function () {
						let clickPost = setInterval(() => {
							aotoClick();
						}, 500);
						let aotoClick = () => {
							if ($("#J_submit")[0]) {
								$("#postSubmit").click();
								clearInterval(clickPost);
							} else {
								console.log("2", $("#J_submit")[0])
							};
						};
						//点击提交-->显示重复图-->删除重复图片
						return setTimeout(function () {
							if ($(".showErrorTip-box .showErrorTip-bottom input").length > 0) {
								$(".showErrorTip-box .showErrorTip-bottom input").click();
								$('.likely-to-be-repeat a').on("click", function () {
									return setTimeout(function () {
										if ($('#findRepeatPic').length > 0) {
											let $iframeDom = $("#findRepeatPicIframe").contents();
											$($iframeDom).find(".delete-adbt")[0].click();
											setTimeout(() => {
												$($iframeDom).find(".J-confirm-yes")[0].click();
											}, 500);
										}
									}, 500);
								});
								$('.likely-to-be-repeat a').click();
							}
						}, 500);
					}, 500);
				}, 300);
			} else {
				GM_setValue("keyCodeStatus", false);
			};
		};
		console.log("自动填充：" + GM_getValue("keyCodeStatus") + "\n（需手动关闭自动填充）");
		$autoComplat();

		//------------------------------------------------------------------------------------------
		//加入立即下载按键
		//过滤广告位 插入下载
		$(".new-search-works-item .search-works-price").parent().after(
			"<div class='appendBox search-works-thumb relative' href>下载文件</div>");
		$(".soso-advertBD-box").css("display", "none");

		//非商用 商用链接数组
		let $dataUrl = [];
		let $nipicUrl = [];
		let $huituUrl = [];
		$(".new-search-works-item>a").each(function (index, obj) {
			let $startNum = $(this).attr("href").lastIndexOf("/") + 1;
			let $url = 'https://down.nipic.cn/download?id=' + $(this).attr("href").slice($startNum, -5) +
				'#showMore';
			$nipicUrl.push($url);
			let $huitu = $(this).attr("href");
			$huituUrl.push($huitu);
		});
		//类别关键词
		let $classWork = [];
		$(".search-works-price").each(function () {
			let $thisWork = String($(this).html()).split("\n")[0];
			$classWork.push($thisWork);
		});
		//判断替换链接
		$(".appendBox").each(function (index, obj) {
			if ($classWork[index] !== "商用作品") {
				$dataUrl.push($nipicUrl[index]);
			} else {
				$dataUrl.push($huituUrl[index]);
			};
			$(this).html("<a href='" + $dataUrl[index] + "'target='_blank'>立即下载</a>");
		});
		//覆盖样式
		$(".new-search-works-item").css({
			"margin-bottom": "75px",
		});
		$(".appendBox").css({
			"background": "#efefef",
			"height": "40px",
			"padding": "0",
			"top": "105%",
		});
		$(".appendBox a").css({
			"display": "block",
			"font-size": "16px",
			"font-weight": "normal",
			"letter-spacing": "0.4em",
			"line-height": "22px",
			"text-align": "center",
			"color": "#666",
			"padding": "8px",
		});
	});
})();